import React from 'react'
import { Col, Row } from 'react-bootstrap'
import Products from '../products'
const ProductPage = () => {
  return (
    <main>
      <Row>
        {Products.map((product) => (
          <Col key={product._id} sm={6} md={4} lg={3}>
            <Product product={product} />
          </Col>
        ))}
      </Row>
    </main>
  )
}

export default ProductPage
